import React from "react";
import SASS from '../assets/img/svg/language-logo/sass.svg'
function importAll(r) {
  let images = {};
  r.keys().map(item => { images[item.replace('./', '')] = r(item); });
  return images;
}



function AllSvgLogo(){
  const images = importAll(require.context('../assets/img/svg/language-logo/', false, /\.(png|jpe?g|svg)$/));
  const result = {};
  console.log(images.length)
  images.forEach(element => {
    var temp = <img src={element}/>;
    result+=temp;
  })
  console.log("appel")
  return(
    <React.Fragment>
      {result}
    </React.Fragment>
  )
}
export default AllSvgLogo
